import express, { Router } from 'express';
import morgan from 'morgan';//  

const PORT = 4000;

const app = express();
const logger = morgan("dev");//morgan get,path, status code   .
app.use(logger);

const globalRouter = express.Router();// 
const handleHome = (req,res) => res.send("Home");
globalRouter.get("/", handleHome);//app.get router.get .


const usersRouter = express.Router();
const handleEditUser = (req, res) => res.send("Users");
usersRouter.get("/edit", handleEditUser);


const videoRouter = express.Router();
const handleWatchVideo = (req, res) => res.send("Watch Video");
videoRouter.get("/watch", handleWatchVideo);



app.use("/", globalRouter);
app.use("/users", usersRouter);
app.use("/videos", videoRouter);














//express, route handler event     .
// req(request)  res(response)

// const routeLogger = (req, res, next) => {
//     next();
// }

// const methodLogger = (req, res, next)=>{// 3  .
//     console.log(`${req.method} ${req.url}`);
//     next();//get    
// }//logger()  



// const home = (req, res)=>{// req  res .
//     //next   .
    
//     return res.send("I love middlewares");//   .  request .
// };

// const login = (req, res) =>{
//     return res.send('login');
// }

//app.use(logger);//app.use     .  ()  .
// use   get  .


//app.use(methodLogger, routeLogger);
// app.get("/", home);//get     . =>      ("/" ,   )
// app.get("/login", login);
// handler(controler) .





const handleListening = () => console.log(`server listenting on port http://localhost:${PORT}`);

app.listen(PORT, handleListening); //      . // 4000  handleListening 

//4.0
